import './App.css';
import Header from "./components/Header";
import CenterText from "./components/CenterText";
import DateInput from "./components/DateInput";
import Result from "./components/Result";
import Footer from "./components/Footer";

function App() {
  return (
    <div id="app">
      <Header />
      <DateInput />
      <CenterText />
      <Result />
      <Footer />
    </div>
  );
}

export default App;
